import React from 'react';
import './CarouselItem.css';


class CarouselItem extends React.Component{
    
    render(){
        return(
            <div>
            <img className="cItem" src={this.props.myImagePath}/>    
            </div>   
        );
    }

}
export default CarouselItem;
